                "Ninja Kamui (stylized in all caps) is an original anime television series produced by E&H Production and Sola Entertainment with executive production by Williams Street. The series aired from February to May 2024 in the United States on Adult Swim's Toonami programming block and in Canada on Adult Swim Canada. After escaping his clan and going into hiding in rural America, former ninja Higan, living under the alias of Joe Logan is ambushed by assassins who exact bloody retribution on him and his family for his betrayal. With his wife and son now dead, Higan returns to his ninja ways to avenge his murdered family and sets his sights on taking down the very clan that made him.",

